import React from "react";
import { UserContainer } from "./ui";

type AddressProps = {
  street: string;
  suite: string;
  city: string;
  zipcode: string;
  geo: {
    lat: string;
    lng: string;
  };
};

type CompanyProps = {
  name: string;
  catchPhrase: string;
  bs: string;
};

export type UserProps = {
  name: string;
  username: string;
  email: string;
  address: AddressProps;
  phone: string;
  website: string;
  company: CompanyProps;
};

const User = ({ name, username, email, address, phone, website, company }: UserProps) => {
  return (
    <tr>
      <td> {name}</td>
      <td> {username}</td>
      <td> {email}</td>
      <td> {address.city}</td>
      <td> {phone}</td>
      <td> {website}</td>
      <td> {name}</td>
    </tr>
  );
};

export default User;
